import React from 'react'
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Header from '../components/ui/Header'
import HomeScreen from '../components/home/Home';
import SpiritScreen from '../components/spirit/SpiritScreen';
import OpportunityScreen from '../components/opportunity/OpportunityScreen';
import CuriosityScreen from '../components/curiosity/CuriosityScreen';
import NotFound from '../components/notfound/NotFound';

export const AppRouters = () => {
    return (
        <BrowserRouter>
            <Header />
            <Routes>
                <Route path='*' element={<NotFound />} />
                <Route path="/" element={<HomeScreen />} />
                <Route path="/spirit" element={<SpiritScreen />} />
                <Route path="/opportunity" element={<OpportunityScreen />} />
                <Route path="/curiosity" element={<CuriosityScreen />} />

            </Routes>
        </BrowserRouter>
    )
}

export default AppRouters
